import { useEffect } from "react";

const Success = ({ orderId }) => {

    useEffect(() => {
        if (!orderId) {
            window.location.href = '/';
        }
    })

    return (
        <div>
            <h1>Payment Successfull!</h1>
            <h3>Your reference no. is #{orderId}.</h3>
            <button>Return</button>
        </div>
    );
};

export default Success;
